import React from 'react';
import { NavigationContainer } from '@react-navigation/native'
import { createStackNavigator } from '@react-navigation/stack';

import {
  HomeScreen,
  LoginScreen,
  RegisterScreen,
  ForgotPasswordScreen,
  Dashboard
} from './screens';

import UpdateUserInformation from './screens/UpdateUserInformation.js';
import CreateUpdateProfile from './screens/CreateUpdateProfile.js';

const AuthNav = createStackNavigator()

const AuthStack = () => {
    <AuthNav.Navigator>
        <AuthNav.Screen
          name = "Home"
          component={HomeScreen}
        />
        <AuthNav.Screen name = "LoginScreen" component = {LoginScreen}/>
        <AuthNav.Screen name = "RegisterScreen" component = {RegisterScreen}/>

      </AuthNav.Navigator>
}

export default AuthStack;
